import React, { useEffect, useState } from 'react';
import fetchAdjustedPrices from './services/api';

const App = () => {
    const [adjustedPrices, setAdjustedPrices] = useState([]); // Initialize with an empty array

    useEffect(() => {
        const fetchData = async () => {
            try {
                const data = await fetchAdjustedPrices(); // Call the API
                console.log('Fetched data:', data);
                setAdjustedPrices(data || []); // Ensure data is not null or undefined
            } catch (error) {
                console.error('Error fetching adjusted prices:', error);
            }
        };

        fetchData();
    }, []);

    return (
        <div>
            <h1>Adjusted Prices</h1>
            <ul>
                {adjustedPrices.map((price, index) => (
                    <li key={index}>
                        Product: {price.product_id}, Adjusted Price: {price.adjusted_price}
                    </li>
                ))}
            </ul>
        </div>
    );
};

export default App;
